import React from "react";
import {
  StyleSheet,
  View,
  Text,
  Button,
  TouchableOpacity,
  TextInput,
  Image,
} from "react-native";
import Sound from "react-native-sound";
export default function Register({ navigation }) {
  const onsubmithandler = () => {
    Sound.setCategory("Playback");

    var whoosh = new Sound("./assets/sound.mp3", Sound.MAIN_BUNDLE, (error) => {
      if (error) {
        console.log("failed to load the sound", error);
        return;
      }
      // loaded successfully
      console.log(
        "duration in seconds: " +
          whoosh.getDuration() +
          "number of channels: " +
          whoosh.getNumberOfChannels()
      );

      // Play the sound with an onEnd callback
      whoosh.play((success) => {
        if (success) {
          console.log("successfully finished playing");
        } else {
          console.log("playback failed due to audio decoding errors");
        }
      });
    });

    return;
  };

  return (
    <View style={styles.container}>
      <View style={styles.container1}></View>
      <View style={styles.container2}>
        <Text style={styles.container21}>Payment</Text>
      </View>
      <View style={styles.container3}>
        <View style={styles.container31}>
          <Text style={styles.container31text}>Pay Now</Text>
        </View>

        <View style={styles.container33}>
          <Text style={styles.container33text}>Details</Text>
        </View>
        <View style={styles.container34}>
          <Text style={styles.container34text1}>Order Id: 1234</Text>
          <Text style={styles.container34text1}>Total: 1234</Text>
        </View>
        <View style={styles.container35}>
          <Text style={styles.container33text}>Card Details</Text>
          <TextInput placeholder="CARD HOLDER NAME" />
          <TextInput
            inputStyle={{ letterSpacing: 20 }}
            placeholder="ENTER CARD NO."
          />
          <TextInput placeholder="ENTER EXPIRE DATE " />
          <TextInput placeholder="ENTER CVV NO " />
          <Image
            style={styles.footerimagestyle}
            source={require("../assets/mastercard-logo.png")}
          />
          <Image
            style={styles.footerimagestyle}
            source={require("../assets/visa.png")}
          />
        </View>

        <TouchableOpacity color="#F57503" onPress={onsubmithandler}>
          <Text>PAY 2022</Text>
        </TouchableOpacity>
      </View>
    </View>
  );
}
const styles = StyleSheet.create({
  container: {
    flex: 1,
    flexDirection: "column",
    justifyContent: "flex-start",
    backgroundColor: "#ffffff",
  },
  container1: {
    width: "100%",
    height: 68,
    backgroundColor: "#ffffff",
    // borderWidth:2,
    // borderColor:'black',
    // borderStyle:'solid',
  },
  container2: {
    width: "100%",
    height: 56,
    paddingLeft: 25,
    paddingTop: 17,
    backgroundColor: "#F57503",
    marginBottom: 30,
    // borderWidth:2,
    // borderColor:'black',
    // borderStyle:'solid',
  },
  container21: {
    fontSize: 16,
    fontWeight: "bold",
    color: "white",
  },
  container3: {
    marginLeft: 25,
    marginRight: 25,
  },
  container31text: {
    fontSize: 14,
    fontWeight: "bold",
    color: "#107B05",
  },
  container32: {
    marginTop: 15,
  },
  container32text: {
    color: "#474747",
    fontSize: 14,
  },
  container33: {
    marginTop: 25,
  },
  container34: {
    borderBottomWidth: 1,
    paddingBottom: 15,
    borderColor: "#979797",
  },
  container33text: {
    color: "#474747",
    fontSize: 14,
    fontWeight: "bold",
    marginBottom: 10,
  },
  container34text1: {
    fontSize: 12,
    fontWeight: "bold",
    color: "#474747",
    marginTop: 5,
  },
  container34text2: {
    marginTop: 5,
    fontSize: 10,
    // fontWeight:'bold',
    color: "#474747",
  },
  container341: {
    flexDirection: "row",
    width: 200,
    justifyContent: "space-between",
  },
  container35: {
    marginTop: 10,
    borderBottomWidth: 1,
    paddingBottom: 15,
    borderColor: "#979797",
  },
});
